                <h4 className='mt-4 mb-10 fs'>Want to know more about our technology stack? Check out the <a href="https://zerodha.tech">Zerodha.tech</a> blog.</h4>
                <br></br><br></br><br></br><br></br>
                <h2>The Zerodha Universe</h2>
                <br></br>
                <h5>Extend your trading and investment experience even further with our partner platforms</h5>
            </div>
            <div className='row-6'>

            </div>
        </div>
    );
}

export default Universe;
